import styled from "styled-components";

export const Container = styled.div`
    margin-top: 1rem;
    display: flex;
    justify-content: center;
`;

export const Box = styled.div`
  display: flex;
  align-items: center;
  p {

    padding: 0 1rem;
    font-size: 0.75rem;
  }

  button {
    display: flex;
    border: 0;
    outline: none;
    justify-content: center;
    align-items: center;
    padding: 6px;
    border-radius: 4px;
  }

  button:disabled {
    border: 1px solid #c2c2c2;
    cursor: unset;
  }
`;
